import React from 'react'
import "../style/Skills.scss";
import { motion } from 'framer-motion'


function Skills2() {
    return(
        <div className="box-container">
            <motion.div 
                className = "box"
                animate = {{
                    x: "80vW",
                    y: "10vH",
                }}
                initial = {{
                    opacity: 0.1
                }} 
                transition = {{
                    duration: 10
                }}
            >

            </motion.div>

        </div>
    )
}

export default Skills2
